import React from 'react';
import {
    SidebarContainer,
    SidebarIcon,
    CloseIcon,
    SidebarContent,
    SidebarMenu,
    SidebarLink
}from './SidebarElements';

const SideBar = ({isOpen,toggle}) => {
    return (
        <>
            <SidebarContainer isOpen={isOpen} onClick={toggle}>
                <SidebarIcon onClick={toggle}>
                    <CloseIcon/>
                </SidebarIcon>
                <SidebarContent>
                    <SidebarMenu>
                        <SidebarLink to='/'>Inicio</SidebarLink>
                        <SidebarLink 
                        to='about' onClick={toggle}
                        offset={20}
                        smooth={true}
                        duration={500}
                        spy={true}
                        >Quienes Somos</SidebarLink>
                        <SidebarLink>Servicios</SidebarLink>
                        <SidebarLink>Nuestros Proyectos</SidebarLink>
                        <SidebarLink>Contacto</SidebarLink>

                    </SidebarMenu>
                </SidebarContent>
            </SidebarContainer>
        </>
    )
}

export default SideBar
